import React from 'react';
function Team(){
    return(
        <>
        <div>
            <h2>Contact Information
            </h2>
            <p>Do you find this tool useful? Find a bug? Have a feature request? Drop me a line and let me know!

                David Galles
                Harney Science Center, Rm 542
                Department of Computer Science
                University of San Francisco
                2130 Fulton St.
                San Francisco, CA 94117-1080 USA

                galles (at) usfca.edu</p>
        </div>
        </>
    );
}
export default Team;
